import React, { Component } from "react";
import history from '../routes/history';

class Navbar extends Component {


    changeRoute(route){
        history.push(route)
    }

    render() {


    return (
      <div class="navbar">
          <span> Logo </span>

          <button onChange={this.changeRoute('register')}> Register </button>
          <button onChange={this.changeRoute('login')}> Login </button>
      </div>
    );
  }
}

Navbar.propTypes = {};

export default Navbar;
